import React from 'react';
import Board from './Board';
import ModuleCard from './Card';
import './plannertemp.css';
import AutoCompleteText from './AutocompleteText';
import { Button } from 'react-bootstrap';

class ModulePlannerPageTemp extends React.Component {
    constructor(props) {
        super(props)
        this.generateCards = this.generateCards.bind(this);
        this.state = {isTextBoxOpen: false};
    }

    generateCards () {

    }

    handleButtonClick() {
        this.setState({isTextBoxOpen: true})
    }

    render () {
        return (
            <div className="container">
                <AutoCompleteText/>
                <Board 
                        id="board-1"
                        className="board">
                    <ModuleCard
                        id="card-1"
                        className="card"
                        draggable="true">
                        <p>Card one</p>
                    </ModuleCard>
                    <Button onClick={handleButtonClick}>Add Module</Button>
                </Board>

                <Board
                        id="board-2"
                        className="board">
                    <ModuleCard
                        id="card-2"
                        className="card"
                        draggable="true">
                        <p>Card two</p>
                    </ModuleCard>

                </Board>
            </div>
        )
    }
}

export default ModulePlannerPageTemp;
